import React from "react";
import ArtistCard from "./artist-card.js";
class PageSearchResult extends React.Component {
  render() {
    return (
      <React.Fragment>
        <div className="container">
          <div className="row">
            <ArtistCard
              img="https://i.pinimg.com/originals/a7/33/fc/a733fccb30d5b24dbea334fe6e2d5d08.jpg"
              titulo="Gustavo Cerati"
            />
            <ArtistCard
              img="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSErlU8FMFu3QKJOHmwCUzyOJLkEeuNRxpHs-R4f7hot9hEN7oBwwrVQG-81lcRNOnrl5U&usqp=CAU"
              titulo="xxxTentacion"
            />
            <ArtistCard
              img="https://styles.redditmedia.com/t5_2skyp/styles/communityIcon_w5cfvb14bwd51.jpg?format=pjpg&s=299d31cc45c2b9d43121f8859cd137461e507e4c"
              titulo="Mac Miller"
            />
            <ArtistCard
              img="https://pbs.twimg.com/profile_images/628956400065114113/rlVdn-bQ_400x400.jpg"
              titulo="Canserbero"
            />
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default PageSearchResult;
